import React, {Component} from 'react'; 
import AboutPage from '../pages/about';

class AboutInfo extends Component {
    return (props) {
        <div>
            <p> Welcome to my portfolio page, my name is {props.name}. </p>
            <p> I am a Colorado native, born and raised right in the heart of Denver</p>
            <p> I have a B.A in Economics and gradudated from the University of Colorado Denver</p>
        </div>
    }
}

export default AboutInfo;
